  const closeCardHandler = (val) => {
    return val;
  };

  return (
    <>
      {closeCardHandler && <Card onCloseCard={closeCardHandler} />}
      <Header />
      <main>
        <Meals />
      </main>
    </>
  );
};

export default App;
